import React, { useState, useEffect } from "react";
import {
  Button,
  TextField,
  List,
  ListItem,
  ListItemText,
  IconButton,
  Paper,
  Typography,
  Grid,
  MenuItem,
  Select,
  FormControl,
  InputLabel,
} from "@mui/material";
import DeleteIcon from "@mui/icons-material/Delete";
import AddItem from "./AddItem"; // Import AddItem if it's a separate component
import axios from "axios"; // Import axios for API calls

const Pantry = ({ updatePantryItems }) => {
  const [pantryInput, setPantryInput] = useState("");
  const [amount, setAmount] = useState("");
  const [measurement, setMeasurement] = useState(""); // Use a dropdown to select measurement
  const [pantryList, setPantryList] = useState([]);
  const [suggestedImages, setSuggestedImages] = useState([]); // State for suggested images

  useEffect(() => {
    // Fetch pantry items from the backend (replace with your actual API call)
    fetch("http://localhost:5000/pantry")
      .then((response) => response.json())
      .then((data) => {
        setPantryList(data || []);
        updatePantryItems(data.map((item) => item.name) || []);
      })
      .catch((error) => console.error("Error fetching pantry items:", error));

    // Fetch suggested images from Pexels when the component mounts
    fetchSuggestedImages();
  }, [updatePantryItems]);

  const fetchSuggestedImages = async () => {
    try {
      const response = await axios.get("https://api.pexels.com/v1/search", {
        headers: {
          Authorization: "YOUR_PEXELS_API_KEY", // Replace with your Pexels API key
        },
        params: {
          query: pantryInput || "food", // You can modify this to match the pantry item
          per_page: 10, // Number of images to fetch
        },
      });
      setSuggestedImages(response.data.photos);
    } catch (error) {
      console.error("Error fetching suggested images:", error);
    }
  };

  const handleAddItem = (newItem) => {
    // Send the new item to the backend (replace with your actual API call)
    fetch("http://localhost:5000/pantry", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(newItem),
    })
      .then((response) => response.json())
      .then((addedItem) => {
        console.log("Item successfully added:", addedItem);
        const updatedPantryList = [...pantryList, addedItem];
        setPantryList(updatedPantryList);
        updatePantryItems(updatedPantryList.map((item) => item.name));
      })
      .catch((error) => {
        console.error("Error adding pantry item:", error);
      });
  };

  const handleRemoveItem = (itemToRemove) => {
    fetch(`http://localhost:5000/pantry/${itemToRemove.id}`, {
      method: "DELETE",
    })
      .then(() => {
        const updatedPantryList = pantryList.filter((item) => item.id !== itemToRemove.id);
        setPantryList(updatedPantryList);
        updatePantryItems(updatedPantryList.map((item) => item.name));
      })
      .catch((error) => console.error("Error removing pantry item:", error));
  };

  return (
    <Paper elevation={3} style={{ padding: "20px" }}>
      <Typography variant="h5" gutterBottom>
        Pantry Management
      </Typography>

      <AddItem addItem={handleAddItem} /> {/* Include the AddItem component */}

      <Typography variant="h6" style={{ marginTop: "20px" }}>
        Suggested Images
      </Typography>

      <Grid container spacing={2} style={{ marginBottom: "20px" }}>
        {suggestedImages.map((image) => (
          <Grid item xs={4} key={image.id}>
            <img
              src={image.src.small}
              alt={image.alt}
              style={{ width: "100%", height: "auto", borderRadius: "8px" }} // Adjust size and style as needed
            />
            <Typography variant="caption">{image.alt}</Typography>
          </Grid>
        ))}
      </Grid>

      <Typography variant="h6" style={{ marginTop: "20px" }}>
        Current Pantry Items
      </Typography>

      <List>
        {pantryList.map((item) => (
          <ListItem key={item.id} secondaryAction={
            <IconButton edge="end" aria-label="delete" onClick={() => handleRemoveItem(item)}>
              <DeleteIcon />
            </IconButton>
          }>
            <img
              src={item.image} // Display the image instead of the name
              alt={item.name}
              style={{ width: '50px', height: '50px', marginRight: '10px' }} // Adjust the size as needed
            />
            <ListItemText primary={`${item.amount} ${item.measurement}`} />
          </ListItem>
        ))}
      </List>
    </Paper>
  );
};

export default Pantry;
